Now we #integrate, #reflect in quiet, #peaceful #contemplation.

So many uncomfortable, painful, disquieting emotions, past hurts, patterns, old stories and old illusions have come to #light.

We see how we were fed the illusion. We grieved how unkind we were to ourselves. We grieved the what ifs. We grieved the could-have-beens. But then, we also rejoiced to see some surprising truths, always there, just past the veils of duality, waiting patiently for us to remember.

And so, we remember our grace, our tenderness, our rising after falling. We remember time has collapsed and for good reason. We realise so many old perspectives that made us attached to our suffering have dissolved into our own embrace. Where there was resistance, we invite ourselves to look kindly and there is a fanning open into #possibilities we could not have imagined.

We affirm: "I am #grateful I am seeing seeing past old #illusions with #ease, #grace, #peace and #clarity."

As the illusions part, our #heart fills up with unspeakable #joy, with #tears in our eyes, we see our own light; the eternal flame.
